import React from "react";
import { Stack, Text, Badge } from "@chakra-ui/core";

const TestSummary = () => {
  return (
    <>
      <Stack>
        <Text>Branch name</Text>
        <Badge
          variantColor="cyan"
          fontSize="14px"
          fontWeight={600}
          rounded="sm"
          padding="0px 4px"
          minH="auto"
          mb={3}
        >
          Successful
        </Badge>
      </Stack>
      <Text>Date</Text>
    </>
  );
};

export default TestSummary;
